import React from 'react';
import {add} from './action/add';

import '../node_modules/@material-ui/core/umd/material-ui.development.js';
import '../node_modules/@material-ui/core/umd/material-ui.production.min.js';

import './App.css';
import Show from './components/show';
import Nav from './components/nav';

const App = props => {
  const submiter = input => {
    switch(input) {
      case 'ADD':
        props.store.dispatch(add())
      default:
        return;
    }
  };
    return (
        <div className="App">
            <Nav handleClick={submiter.bind(null)}/>
            <Show store={
                props.store
            }/>
        </div>
    );
}

export default App;
